import React from 'react';

const Header = () => {
    return ( 
        <React.Fragment>
            <div className='logo'>
            </div>
            <div className='login-button'>
                <button><a href="/login">Đăng nhập</a></button>
            </div>
        </React.Fragment>
     );
}
 
export default Header;
